// ===== Audio System =====
let audioCtx=null;
let audioUnlocked=false;
let soundEnabled=true;

function getAudioCtx(){
  if(!soundEnabled) return null;
  if(!audioCtx){
    try{
      audioCtx=new (window.AudioContext||window.webkitAudioContext)();
    }catch(e){
      return null;
    }
  }
  if(audioCtx.state==='suspended') audioCtx.resume();
  return audioCtx;
}

// Unlock audio on first user interaction (required for sandboxed iframes)
async function unlockAudio(){
  if(audioUnlocked) return;
  const ctx=getAudioCtx();
  if(!ctx) return;
  try{
    if(ctx.state==='suspended') await ctx.resume();
    const buf=ctx.createBuffer(1,1,22050);
    const src=ctx.createBufferSource();
    src.buffer=buf; src.connect(ctx.destination);
    src.start(0); src.stop(ctx.currentTime+0.01);
    try{
      const a=new Audio();
      a.src='data:audio/wav;base64,UklGRiQAAABXQVZFZm10IBAAAAABAAEARKwAAIhYAQACABAAZGF0YQAAAAA=';
      a.volume=0; a.play().then(()=>a.pause()).catch(()=>{});
    }catch(e){}
    audioUnlocked=true;
    updateAudioIndicator();
    BGM.idle();
  }catch(e){}
}

async function ensureAudioReady(){
  await unlockAudio();
  const ctx=getAudioCtx();
  if(ctx&&ctx.state==='suspended') await ctx.resume();
}

function updateAudioIndicator(){
  const btn=document.getElementById('tbSound');
  if(!btn) return;
  if(audioUnlocked && audioCtx && audioCtx.state==='running' && soundEnabled){
    btn.classList.add('on');
  }
}

// Attach unlock to many interaction types
['click','touchstart','keydown'].forEach(evt=>{
  document.addEventListener(evt, function _unlock(){ unlockAudio(); },{capture:true,passive:true});
});

