let fanfareAudioCache={};
function playFanfare(type){
  if(!soundEnabled) return;
  // ??????????????????
  Object.values(fanfareAudioCache).forEach(a=>{
    try{ a.pause(); a.currentTime=0; }catch(e){}
  });
  
  if(!FANFARE_AUDIO[type]) return;
  
  // ?????????????????????????????
  if(!fanfareAudioCache[type]){
    fanfareAudioCache[type] = new Audio(FANFARE_AUDIO[type]);
  }
  
  const audio = fanfareAudioCache[type];
  audio.currentTime = 0;
  audio.volume = 0.8;
  audio.play().catch(()=>{});
}

