// ===== BGM System =====
const BGM={
  _nodes:[], _masterGain:null, _state:'none', _vol:0.5,
  _getMaster(){
    if(!BGM._masterGain){
      const ctx=getAudioCtx();
      if(!ctx) return null;
      BGM._masterGain=ctx.createGain();
      BGM._masterGain.gain.value=BGM._vol;
      BGM._masterGain.connect(ctx.destination);
    }
    return BGM._masterGain;
  },
  _stopAll(fadeTime){
    const ctx=getAudioCtx(); if(!ctx) return; const now=ctx.currentTime, ft=fadeTime||0.8;
    BGM._nodes.forEach(n=>{
      try{
        if(n.gain) n.gain.gain.linearRampToValueAtTime(0, now+ft);
        setTimeout(()=>{ try{n.src.stop();}catch(e){} }, ft*1000+100);
      }catch(e){}
    });
    BGM._nodes=[];
  },
  async _playCustomBGM(){
    const dataUrl=config.bgmFile;
    if(!dataUrl) return false;
    const ctx=getAudioCtx(); if(!ctx) return false;
    try{
      const res=await fetch(dataUrl);
      const buf=await res.arrayBuffer();
      const audioBuf=await ctx.decodeAudioData(buf);
      const src=ctx.createBufferSource();
      const g=ctx.createGain(); g.gain.value=BGM._vol;
      src.buffer=audioBuf; src.loop=true;
      src.connect(g); g.connect(BGM._getMaster()); src.start(0);
      BGM._nodes.push({src,gain:g});
      return true;
    }catch(e){ return false; }
  },
  idle(){
    if(BGM._state==='idle') return;
    BGM._stopAll(1.0); BGM._state='idle';
    BGM._playCustomBGM().then(ok=>{
      if(ok) return;
      const ctx=getAudioCtx(); if(!ctx) return; const now=ctx.currentTime, master=BGM._getMaster(); if(!master) return;
      [130.81, 164.81, 196.00, 246.94].forEach(freq=>{
        const o=ctx.createOscillator(); o.type='sine'; o.frequency.value=freq;
        const lfo=ctx.createOscillator(); lfo.frequency.value=0.3+Math.random()*0.4;
        const lfoG=ctx.createGain(); lfoG.gain.value=3;
        lfo.connect(lfoG); lfoG.connect(o.detune); lfo.start(now);
        const g=ctx.createGain(); g.gain.setValueAtTime(0,now); g.gain.linearRampToValueAtTime(0.18,now+2);
        const flt=ctx.createBiquadFilter(); flt.type='lowpass'; flt.frequency.value=400;
        o.connect(flt); flt.connect(g); g.connect(master); o.start(now);
        BGM._nodes.push({src:o,gain:g},{src:lfo,gain:null});
      });
    });
  },
  spin(){
    if(BGM._state==='spin') return;
    BGM._stopAll(0.3); BGM._state='spin';
    BGM._playCustomBGM().then(ok=>{
      if(ok) return;
      const ctx=getAudioCtx(); if(!ctx) return; const now=ctx.currentTime, master=BGM._getMaster(); if(!master) return;
      const bass=ctx.createOscillator(); bass.type='sawtooth'; bass.frequency.value=82.41;
      const bassG=ctx.createGain(); bassG.gain.setValueAtTime(0,now); bassG.gain.linearRampToValueAtTime(0.15,now+0.3);
      const bassFlt=ctx.createBiquadFilter(); bassFlt.type='lowpass'; bassFlt.frequency.value=200;
      const pulseLfo=ctx.createOscillator(); pulseLfo.frequency.value=4;
      const pulseG=ctx.createGain(); pulseG.gain.value=0.06;
      pulseLfo.connect(pulseG); pulseG.connect(bassG.gain); pulseLfo.start(now);
      bass.connect(bassFlt); bassFlt.connect(bassG); bassG.connect(master); bass.start(now);
      BGM._nodes.push({src:bass,gain:bassG},{src:pulseLfo,gain:null});
      [493.88, 659.25].forEach(freq=>{
        const o=ctx.createOscillator(); o.type='sine'; o.frequency.value=freq;
        const g=ctx.createGain(); g.gain.setValueAtTime(0,now); g.gain.linearRampToValueAtTime(0.05,now+0.5);
        o.connect(g); g.connect(master); o.start(now);
        BGM._nodes.push({src:o,gain:g});
      });
    });
  },
  win(){
    BGM.stop();
  },
  stop(){ BGM._stopAll(0.5); BGM._state='none'; }
};
