// Generate stars in 3 parallax layers
function generateStars(containerId, count, sizeRange){
  const c=document.getElementById(containerId);
  for(let i=0;i<count;i++){
    const s=document.createElement('div');
    s.className='star'+(Math.random()>0.7?' twinkle':'');
    const size=sizeRange[0]+Math.random()*(sizeRange[1]-sizeRange[0]);
    s.style.width=size+'px'; s.style.height=size+'px';
    s.style.left=Math.random()*200+'%';
    s.style.top=Math.random()*200+'%';
    if(s.classList.contains('twinkle')){
      s.style.animationDuration=(2+Math.random()*4)+'s';
      s.style.animationDelay=Math.random()*5+'s';
    }
    const colors=['#fff','#fff','#fff','#aaddff','#ffeedd','#ddddff'];
    s.style.background=colors[Math.floor(Math.random()*colors.length)];
    s.style.opacity=0.3+Math.random()*0.7;
    c.appendChild(s);
  }
}
