// ===== Shooting Star System =====
const ssPool=document.getElementById('shootingStarPool');
const RANK_SS_CONFIG={
  normal: {count:0},
  big:    {count:5, interval:600, colors:['#00E5FF','#4dd9ff'], len:[120,250], speed:[0.6,1.0]},
  super:  {count:10, interval:350, colors:['#FFD93D','#ff8c00','#ffe066'], len:[150,350], speed:[0.8,1.4]},
  mega:   {count:20, interval:180, colors:['#FF2D78','#A855F7','#FFD93D','#00E5FF','#fff'], len:[180,450], speed:[1.0,1.8]}
};

function fireShootingStar(opts={}){
  const color=opts.color||'#fff';
  const length=opts.length||(120+Math.random()*200);
  const speed=opts.speed||1;
  const startX=opts.x!==undefined?opts.x:(Math.random()*85);
  const startY=opts.y!==undefined?opts.y:(3+Math.random()*45);
  const angle=opts.angle!==undefined?opts.angle:(-10-Math.random()*35);

  const el=document.createElement('div');
  el.className='shooting-star';
  el.style.color=color;
  el.style.left=startX+'%';
  el.style.top=startY+'%';
  el.style.width=length+'px';
  el.style.transform=`rotate(${angle}deg)`;
  el.innerHTML='<div class="ss-tail"></div><div class="ss-head"></div>';
  ssPool.appendChild(el);

  const dur=0.5/speed;
  requestAnimationFrame(()=>{
    el.style.transition=`opacity 0.1s ease-in, transform ${dur}s linear`;
    el.style.opacity='0.95';
    el.style.transform=`rotate(${angle}deg) translateX(${length*4}px)`;
    setTimeout(()=>{el.style.opacity='0';},dur*400);
    setTimeout(()=>{el.remove();},dur*1200);
  });
}

