// ===== Build Reel =====
function shuffleArray(arr){
  for(let i=arr.length-1;i>0;i--){
    const j=Math.floor(Math.random()*(i+1));
    [arr[i],arr[j]]=[arr[j],arr[i]];
  }
  return arr;
}
const RANK_LABELS={mega:'MBIG',super:'SBIG',big:'BIG',normal:'HIT'};
function formatNameForDisplay(s){
  const t=(s||'').replace(/&/g,'&amp;').replace(/</g,'&lt;').replace(/>/g,'&gt;').replace(/"/g,'&quot;');
  return t.replace(/\n/g,'<br>');
}
function rankBadgeHTML(rank){ return `<div class="item-rank ${rank||'normal'}">${RANK_LABELS[rank]||'HIT'}</div>`; }
function getPlaceholderImageUrl(name,rank){
  const raw=(name||'賞品').replace(/&/g,'&amp;').replace(/</g,'&lt;').replace(/>/g,'&gt;').replace(/"/g,'&quot;');
  const maxLen=10;
  let lines=[];
  raw.split('\n').forEach(ln=>{
    for(let i=0;i<ln.length;i+=maxLen) lines.push(ln.slice(i,i+maxLen));
  });
  if(lines.length>2) lines=[lines[0],lines[1]+'…'];
  const colors={mega:'#9333ea',super:'#0ea5e9',big:'#f59e0b',normal:'#64748b'};
  const bg=colors[rank]||colors.normal;
  const fs=lines.length>1?12:14;
  const y0=lines.length>1?92:100;
  const ts=lines.map((l,i)=>`<tspan x="100" dy="${i===0?0:16}">${l}</tspan>`).join('');
  const svg=`<svg xmlns="http://www.w3.org/2000/svg" width="200" height="200" viewBox="0 0 200 200"><rect fill="${bg}" width="200" height="200"/><text x="100" y="${y0}" fill="white" font-size="${fs}" font-family="Zen Maru Gothic,sans-serif" text-anchor="middle">${ts}</text></svg>`;
  return 'data:image/svg+xml,'+encodeURIComponent(svg);
}
function getDisplayImageUrl(slot){ return (slot?.imageUrl||'')||getPlaceholderImageUrl(slot?.name,slot?.rank); }
/** リール画像の読み込み失敗時（404等）にプレースホルダーに差し替える。img の onerror から呼ぶ */
function reelImgFallback(imgEl){
  const item=imgEl&&imgEl.closest('.reel-item');
  if(!item) return;
  const nameEl=item.querySelector('.item-name');
  const rankEl=item.querySelector('.item-rank');
  const name=nameEl?nameEl.textContent.trim():'賞品';
  const m=rankEl&&rankEl.className.match(/\b(mega|super|big|normal)\b/);
  const rank=m?m[1]:'normal';
  imgEl.src=getPlaceholderImageUrl(name,rank);
}
function reelItemHTML(slot){
  const r=slot.rank||'normal', name=slot.name||'', hasRealImg=!!(slot.imageUrl||'');
  const dispImg=getDisplayImageUrl(slot);
  const slotNo=slot.slotNo||0;
  const slotIdx=slotNo-1;
  const nameAttr=(name||'賞品').replace(/&/g,'&amp;').replace(/"/g,'&quot;').replace(/</g,'&lt;').replace(/>/g,'&gt;');
  const pinClass=hasRealImg?'reel-item-upload'+(isPrizeDefaulted(slot.name,slot.rank)?' pin-defaulted':''):'';
  return `${rankBadgeHTML(r)}<div class="reel-item-btns"><button type="button" class="reel-item-upload" onclick="triggerReelSlotUpload(${slotIdx})" title="No.${slotNo}の画像をアップロード">📷</button><button type="button" class="reel-item-upload" onclick="triggerReelSlotUrl(${slotIdx})" title="No.${slotNo}の画像URLを貼り付け">🔗</button>${hasRealImg?`<button type="button" class="${pinClass}" onclick="setReelSlotImageAsDefault(${slotIdx})" title="この画像をデフォルトに設定">📌</button>`:''}</div><div class="item-no">No.${slotNo}</div><div class="reel-item-img-wrap" title="タップで拡大" data-name="${nameAttr}"><img src="${dispImg}" onerror="typeof reelImgFallback==='function'&&reelImgFallback(this)" style="width:80px;height:80px;object-fit:cover;border-radius:12px;"></div><div class="item-name">${formatNameForDisplay(name)||'賞品'}</div>`;
}
function buildReel(){
  const strip=document.getElementById('reelStrip');
  if(!strip){
    console.warn('buildReel: #reelStrip が見つかりません');
    logPanel('⚠ リール: reelStrip 要素なし', true);
    return;
  }
  // 呼び出し元を記録（リールが消えた条件を特定するため）
  const _st=(new Error().stack||'').split('\n');
  let _caller='不明';
  for(let i=1;i<_st.length;i++){
    const L=_st[i].trim();
    if(L.includes('script.js')&&L.includes('at ')&&!L.includes('buildReel')){ _caller=L; break; }
  }
  window.__lastBuildReelCaller=_caller;
  window.__lastBuildReelState=state;
  // strip を更新してよいのは idle か showing のときだけ（spinning/stopping では絶対に触らない）
  if(state!=='idle'&&state!=='showing'){
    pushReelEvent('buildReel_skip', state);
    console.warn('[LUCKY-DRAW] buildReel スキップ state='+state+' 呼び出し元='+_caller);
    return;
  }
  if(!config.slotAssignments||!Array.isArray(config.slotAssignments)||config.slotAssignments.length===0){
    // prizePool があれば slotAssignments を再計算してリールを表示する（復元）
    if(config.prizePool&&Array.isArray(config.prizePool)&&config.prizePool.length>0){
      computeSlotAssignments();
    }
    if(!config.slotAssignments||config.slotAssignments.length===0){
      console.warn('buildReel: 賞品未設定のためスキップ (slotAssignments=', config.slotAssignments, ')');
      logPanel('⚠ リール: 賞品未設定のためスキップ', true);
      return;
    }
  }
  remainingSlotIndices=config.slotAssignments.map((_,i)=>i).filter(i=>!drawnSlotIndices.has(i));
  const fullCount=remainingSlotIndices.length;
  const allDrawn=fullCount===0;
  if(allDrawn){
    setBtnState('start');
    const btn=document.getElementById('bigBtn'); if(btn) btn.disabled=true;
  } else {
    const btn=document.getElementById('bigBtn'); if(btn) btn.disabled=false;
  }
  // 数字順のみ（ランダムモード削除）。全抽選済みでもリールは全スロット表示で構築
  reelDisplayIndices=allDrawn
    ? config.slotAssignments.map((_,i)=>i)
    : remainingSlotIndices.slice();
  totalItems=reelDisplayIndices.length;
  if(totalItems===0){
    console.warn('buildReel: totalItems=0 のためスキップ');
    logPanel('⚠ リール: totalItems=0 のためスキップ', true);
    return;
  }
  const repeats=totalItems>50?2:5;
  const frag=document.createDocumentFragment();
  try {
    for(let r=0;r<repeats;r++){
      for(let idx=0;idx<totalItems;idx++){
        const si=reelDisplayIndices[idx];
        const raw=config.slotAssignments[si];
        const slot=raw ? {...raw, slotNo:si+1} : {rank:'normal',name:'賞品',slotNo:si+1};
        const el=document.createElement('div');
        el.className='reel-item';
        el.innerHTML=reelItemHTML(slot);
        frag.appendChild(el);
      }
    }
  } catch(e){
    console.error('buildReel 構築エラー', e);
    logPanel('⚠ リール構築エラー: ' + (e&&e.message ? e.message : String(e)), true);
    return;
  }
  if(frag.childNodes.length===0){
    console.warn('buildReel: fragment が空のためスキップ');
    logPanel('⚠ リール: fragment が空のためスキップ', true);
    return;
  }
  // strip の子を差し替える直前に再チェック（idle/showing 以外では絶対に実行しない）
  if(state!=='idle'&&state!=='showing'){
    console.warn('[LUCKY-DRAW] buildReel: state='+state+' のため strip 更新をスキップ');
    return;
  }
  try {
    const hadChildren=strip.children.length;
    pushReelEvent('buildReel_clear', 'state='+state+' had='+hadChildren);
    window.__lastReelClearCaller=window.__lastBuildReelCaller||_caller;
    if(hadChildren>0){
      const msg='buildReel: stripの子を入れ替え 既存='+hadChildren+' → 新規='+frag.childNodes.length+' state='+state;
      logPanel('📌 '+msg, true);
      console.log('[LUCKY-DRAW] '+msg);
    }
    while(strip.firstChild) strip.removeChild(strip.firstChild);
    while(frag.firstChild) strip.appendChild(frag.firstChild);
  } catch(e){
    console.error('buildReel 子要素の差し替えエラー', e);
    logPanel('⚠ リール 子要素の差し替えエラー: ' + (e&&e.message ? e.message : String(e)), true);
    return;
  }
  logPanel('  buildReel 完了 strip.children='+strip.children.length, false);
  const fw=document.getElementById('reelFrame').offsetWidth;
  reelPos=-(fw/2 - ITEM_W/2) + 16;
  strip.style.transform=`translateX(${reelPos}px)`;
  updateHistoryCount();
  if(state==='idle') showReelNav(true);
}

