// ===== 自動配分（在庫数＝リールNo. 確率に従いランダム配分） =====
function computeSlotAssignments(){
  const pool=config.prizePool||[];
  const entries=[];
  pool.forEach(p=>{
    const n=Math.max(0,parseInt(p.count,10)||0);
    for(let i=0;i<n;i++) entries.push({rank:p.rank||'normal',name:p.name||'',imageUrl:p.imageUrl||''});
  });
  if(entries.length===0){ config.slotAssignments=[]; return; }
  shuffleArray(entries);
  config.slotAssignments=entries.map((s,i)=>({...s,slotNo:i+1}));
}

