const MAX_IMAGE_BYTES=2*1024*1024;
function resizeImageToMaxSize(file,maxBytes,cb){
  if(file.size<=maxBytes){
    const r=new FileReader();
    r.onload=()=>cb(r.result);
    r.readAsDataURL(file);
    return;
  }
  const img=new Image();
  const url=URL.createObjectURL(file);
  img.onload=()=>{
    URL.revokeObjectURL(url);
    const c=document.createElement('canvas');
    let w=img.width,h=img.height;
    const scale=Math.min(1,Math.sqrt(maxBytes*0.7/(w*h)));
    w=Math.round(w*scale); h=Math.round(h*scale);
    c.width=w; c.height=h;
    const ctx=c.getContext('2d');
    ctx.drawImage(img,0,0,w,h);
    let q=0.85;
    function tryQuality(){
      const data=c.toDataURL('image/jpeg',q);
      if(data.length*0.75<=maxBytes || q<=0.3){ cb(data); return; }
      q-=0.15;
      tryQuality();
    }
    tryQuality();
  };
  img.onerror=()=>{ URL.revokeObjectURL(url); cb(null); };
  img.src=url;
}
function uploadPrizePoolImage(poolIdx,input){
  const file=input.files[0];
  if(!file){ input.value=''; return; }
  resizeImageToMaxSize(file,MAX_IMAGE_BYTES,(dataUrl)=>{
    if(!dataUrl){ alert('画像の読み込みに失敗しました'); return; }
    const pool=config.prizePool||[];
    if(poolIdx<0||poolIdx>=pool.length) return;
    const p=pool[poolIdx];
    p.imageUrl=dataUrl;
    config.slotAssignments.forEach(s=>{ if(s.name===p.name&&s.rank===p.rank) s.imageUrl=dataUrl; });
    buildPrizeGrid(); buildReel(); rebuildHistoryDOM(); saveToStorage();
    logPanel(`賞品「${p.name}」の画像をアップロードしました`+(file.size>MAX_IMAGE_BYTES?' (2MBにリサイズ済み)':''));
  });
  input.value='';
}
function triggerUrlPasteForPool(poolIdx){
  const url=prompt('画像URLを貼り付けてください（https:// または data:）','');
  if(!url||!url.trim()) return;
  if(!/^https?:\/\//i.test(url)&&!/^data:/.test(url)){ alert('有効なURLを入力してください'); return; }
  const pool=config.prizePool||[];
  if(poolIdx<0||poolIdx>=pool.length) return;
  const p=pool[poolIdx];
  p.imageUrl=url.trim();
  config.slotAssignments.forEach(s=>{ if(s.name===p.name&&s.rank===p.rank) s.imageUrl=p.imageUrl; });
  buildPrizeGrid(); buildReel(); rebuildHistoryDOM(); saveToStorage();
  logPanel(`賞品「${p.name}」の画像をURLから設定しました`);
}
function isPrizeDefaulted(name,rank){ return defaultedPrizeKeys.has((name||'')+'\0'+(rank||'normal')); }
function setPrizeImageAsDefault(poolIdx){
  const pool=config.prizePool||[];
  if(poolIdx<0||poolIdx>=pool.length||!pool[poolIdx].imageUrl) return;
  const p=pool[poolIdx];
  const img=p.imageUrl;
  defaultedPrizeKeys.add((p.name||'')+'\0'+(p.rank||'normal'));
  config.slotAssignments.forEach(s=>{ if(s.name===p.name&&s.rank===p.rank) s.imageUrl=img; });
  buildPrizeGrid(); buildReel(); rebuildHistoryDOM(); saveToStorage();
  logPanel(`賞品「${p.name}」の画像をデフォルトに設定しました`);
}
function setReelSlotImageAsDefault(slotIdx){
  const slots=config.slotAssignments||[];
  if(slotIdx<0||slotIdx>=slots.length||!slots[slotIdx].imageUrl) return;
  const s=slots[slotIdx];
  const img=s.imageUrl;
  defaultedPrizeKeys.add((s.name||'')+'\0'+(s.rank||'normal'));
  const pool=config.prizePool||[];
  const p=pool.find(x=>x.name===s.name&&x.rank===s.rank);
  if(p) p.imageUrl=img;
  config.slotAssignments.forEach(x=>{ if(x.name===s.name&&x.rank===s.rank) x.imageUrl=img; });
  buildPrizeGrid(); buildReel(); rebuildHistoryDOM(); saveToStorage();
  logPanel(`「${s.name}」の画像をデフォルトに設定しました`);
}
function setAllImagesAsDefault(){
  const pool=config.prizePool||[];
  const slots=config.slotAssignments||[];
  const imgByKey={};
  pool.forEach(p=>{
    if(p.imageUrl){ const k=p.name+'\0'+p.rank; if(!imgByKey[k]) imgByKey[k]=p.imageUrl; }
  });
  slots.forEach(s=>{
    if(s.imageUrl){ const k=s.name+'\0'+s.rank; if(!imgByKey[k]) imgByKey[k]=s.imageUrl; }
  });
  Object.keys(imgByKey).forEach(k=>{
    defaultedPrizeKeys.add(k);
    const [name,rank]=k.split('\0');
    const img=imgByKey[k];
    pool.forEach(p=>{ if(p.name===name&&p.rank===rank) p.imageUrl=img; });
    slots.forEach(s=>{ if(s.name===name&&s.rank===rank) s.imageUrl=img; });
  });
  buildPrizeGrid(); buildReel(); rebuildHistoryDOM(); saveToStorage();
  logPanel(`📌 ${Object.keys(imgByKey).length}件の賞品画像を一括でデフォルトに設定しました`);
}
