function extractSpreadsheetId(val){
  const s=String(val||'').trim();
  if(!s) return '';
  const m=s.match(/\/d\/([a-zA-Z0-9_-]+)/);
  return m ? m[1] : s;
}
function parseRank(v){
  const s=String(v||'').trim();
  const lower=s.toLowerCase();
  if(/megasuperbighit|mega|mbig|メガ/.test(lower)) return 'mega';
  if(/superbighit|super|sbig|超/.test(lower)) return 'super';
  if(/bighit|big|大/.test(lower)) return 'big';
  if(/^hit$/i.test(s) || /当/.test(s)) return 'normal';
  return 'normal';
}
function resolveImageUrl(val){
  const s=String(val||'').trim();
  if(!s) return '';
  if(/^data:/.test(s)) return s;
  let m=s.match(/drive\.google\.com\/file\/d\/([a-zA-Z0-9_-]+)/);
  if(m) return 'https://drive.google.com/uc?export=view&id='+m[1];
  m=s.match(/drive\.google\.com\/open\?id=([a-zA-Z0-9_-]+)/);
  if(m) return 'https://drive.google.com/uc?export=view&id='+m[1];
  if(/^[a-zA-Z0-9_-]{20,}$/.test(s)) return 'https://drive.google.com/uc?export=view&id='+s;
  if(/^https?:\/\//i.test(s)) return s;
  return '';
}
function toPrizePicsId(val){
  const s=String(val||'').trim();
  if(!s) return null;
  const m=s.match(/LD_?0*(\d+)/i)||s.match(/^(\d+)$/);
  return m?'LD_'+String(parseInt(m[1],10)).padStart(4,'0'):null;
}
const PRIZE_PICS_EXTS=['.png','.jpg','.jpeg','.PNG','.JPG','.JPEG'];
async function resolvePrizePicsUrl(imgNo){
  const id=typeof imgNo==='string'?toPrizePicsId(imgNo):(imgNo!=null?'LD_'+String(imgNo).padStart(4,'0'):null);
  if(!id) return '';
  const base=(location.origin||'')+'/prize_pics/'+id;
  for(const ext of PRIZE_PICS_EXTS){
    try{
      const r=await fetch(base+ext,{method:'GET',cache:'no-cache'});
      if(r.ok) return base+ext;
    }catch(_){}
  }
  // ファイルが存在しない場合は空を返し、表示時にプレースホルダー（SVG）が使われるようにする
  return '';
}
function parseCSVLine(line){
  const r=[]; let cur=''; let inQ=false;
  for(let i=0;i<line.length;i++){
    const c=line[i];
    if(c==='"') inQ=!inQ;
    else if(c===','&&!inQ){ r.push(cur.replace(/^"|"$/g,'').trim()); cur=''; }
    else cur+=c;
  }
  r.push(cur.replace(/^"|"$/g,'').trim());
  return r;
}
/** 引用符内の改行を正しく扱うCSVパーサー（RFC4180準拠） */
function parseCSVFull(text){
  const rows=[]; let row=[]; let cur=''; let inQ=false;
  for(let i=0;i<text.length;i++){
    const c=text[i];
    if(c==='"'){
      if(inQ&&text[i+1]==='"'){ cur+='"'; i++; continue; }
      inQ=!inQ; continue;
    }
    if(!inQ){
      if(c===','){ row.push(cur.replace(/^"|"$/g,'').trim()); cur=''; continue; }
      if(c==='\n'||c==='\r'){
        if(c==='\r'&&text[i+1]==='\n') i++;
        row.push(cur.replace(/^"|"$/g,'').trim()); rows.push(row); row=[]; cur=''; continue;
      }
    }
    cur+=c;
  }
  row.push(cur.replace(/^"|"$/g,'').trim()); if(row.length>0||cur.length>0) rows.push(row);
  return rows;
}
/** 賞品プール形式A: レート,賞品名,本数,画像URL */
async function applySheetRowsPool(rows,spreadsheetId){
  let startRow=0;
  if(rows[0]&&/^(レート|rank|賞品名|商品名|本数|count)/i.test(String(rows[0][0]||'').trim())) startRow=1;
  const pool=[];
  for(let i=startRow;i<rows.length;i++){
    const row=rows[i]||[];
    const rank=parseRank(String(row[0]||'').trim());
    const name=String(row[1]||'').trim();
    const count=Math.max(0,parseInt(row[2],10)||0);
    if(!name&&count===0) continue;
    let imageUrl=resolveImageUrl(row[3]||row[4]||'');
    if(!imageUrl){
      const pid=toPrizePicsId(row[3]||row[4]||'');
      if(pid) imageUrl='prize_pics:'+pid;
    }
    pool.push({rank,name:name||'賞品',count,imageUrl});
  }
  return await applyPoolFinal(pool,spreadsheetId);
}
/** 形式B: 管理No.,賞品レート,商品名,文字数,当選個数,画像No (prize_list形式) */
async function applySheetRowsPrizeList(rows,spreadsheetId){
  let startRow=0;
  const h0=String((rows[0]||[])[0]||'').trim();
  const h1=String((rows[0]||[])[1]||'').trim();
  if(/管理No|賞品レート|商品名/i.test(h0)||/賞品レート|商品名/i.test(h1)) startRow=1;
  const pool=[];
  for(let i=startRow;i<rows.length;i++){
    const row=rows[i]||[];
    const rank=parseRank(String(row[1]||'').trim());
    const name=String(row[2]||'').trim();
    const count=Math.max(0,parseInt(row[4],10)||0);
    if(!name&&count===0) continue;
    let imageUrl=resolveImageUrl(row[5]||row[6]||'');
    if(!imageUrl){
      const pid=toPrizePicsId(row[5]||row[6]||'');
      if(pid) imageUrl='prize_pics:'+pid;
    }
    pool.push({rank,name:name||'賞品',count,imageUrl});
  }
  return applyPoolFinal(pool,spreadsheetId);
}
async function applyPoolFinal(pool,spreadsheetId){
  if(pool.length===0){ logPanel('賞品プールが空です'); return 0; }
  await Promise.all(pool.map(async p=>{
    const v=String(p.imageUrl||'');
    if(v.startsWith('prize_pics:')){
      const id=v.slice(11);
      p.imageUrl=await resolvePrizePicsUrl(id);
    }
  }));
  const existingByKey={};
  (config.prizePool||[]).forEach(p=>{ if(p.imageUrl){ const k=(p.name||'')+'\0'+(p.rank||'normal'); existingByKey[k]=p.imageUrl; } });
  (config.slotAssignments||[]).forEach(s=>{ if(s.imageUrl){ const k=(s.name||'')+'\0'+(s.rank||'normal'); if(!existingByKey[k]) existingByKey[k]=s.imageUrl; } });
  pool.forEach(p=>{
    if(!p.imageUrl||!/^(https?:|data:)/i.test(String(p.imageUrl))){
      const k=(p.name||'')+'\0'+(p.rank||'normal');
      if(existingByKey[k]) p.imageUrl=existingByKey[k];
    }
  });
  config.prizePool=pool;
  config.spreadsheetId=spreadsheetId;
  computeSlotAssignments();
  buildPrizeGrid();
  rebuildHistoryDOM();
  buildReel();
  saveToStorage();
  saveProgress();
  const total=config.slotAssignments.length;
  logPanel(`📊 賞品プール ${pool.length}種・合計${total}本を反映しました`);
  return total;
}
async function applySheetRows(rows,spreadsheetId){
  if(rows.length===0) return 0;
  const r0=rows[0]||[];
  const h0=String(r0[0]||'').trim();
  const h1=String(r0[1]||'').trim();
  if(/^(レート|rank|賞品名|商品名)/i.test(h0)){
    return await applySheetRowsPool(rows,spreadsheetId);
  }
  if(/管理No|賞品レート|商品名/i.test(h0)||/賞品レート|商品名/i.test(h1)){
    return await applySheetRowsPrizeList(rows,spreadsheetId);
  }
  const st=document.getElementById('sheetStatus');
  if(st){ st.textContent='⚠ スプシ形式が未対応です。管理No.,賞品レート,商品名,当選個数 または レート,賞品名,本数 の形式で'; st.style.color='#f87171'; }
  logPanel('⚠ スプシ形式が未対応です');
  return 0;
}
function loadImagesFromSheetUrls(){
  const urls=config.prizeImageUrls||{};
  const keys=Object.keys(urls);
  keys.forEach(no=>{ const u=urls[no]; if(u&&u.startsWith('data:')) config.imageCache[parseInt(no,10)]=u; });
  if(keys.length===0) return;
  let ld=0,fl=0;
  const ck=()=>{
    if(ld+fl>=keys.length){
      const el=document.getElementById('sheetStatus');
      if(el&&ld>0){ const t=el.textContent; if(!t.includes('画像')) el.textContent=t+(t.endsWith('ました')?' 画像'+ld+'枚':''); }
      buildPrizeGrid();
      buildReel();
      rebuildHistoryDOM();
    }
  };
  keys.forEach(no=>{
    const n=parseInt(no,10);
    const u=urls[no];
    if(u&&u.startsWith('data:')){ ld++; ck(); return; }
    const img=new Image();
    img.onload=()=>{ ld++; config.imageCache[n]=u; ck(); };
    img.onerror=()=>{ fl++; ck(); };
    img.src=u;
  });
}
async function loadPrizesFromSheet(){
  const el=document.getElementById('sheetStatus');
  if(window.location.protocol==='file:'){
    el.textContent='⚠️ ファイルを直接開いています。ターミナルで「npm start」または「python3 -m http.server 3000」を実行し、http://localhost:3000 で開いてください'; el.style.color='#f87171';
    return;
  }
  const csvUrl=PRIZE_CSV_URL;
  el.textContent='読み込み中...'; el.style.color='var(--text-dim)';
  const proxies=['https://corsproxy.io/?url='+encodeURIComponent(csvUrl),'https://api.allorigins.win/raw?url='+encodeURIComponent(csvUrl)];
  try{
    let r=null;
    try{ r=await fetch(csvUrl); }catch(_){}
    if(!r||!r.ok){ for(const u of proxies){ try{ r=await fetch(u); if(r&&r.ok) break; }catch(_){}}}
    if(r&&r.ok){
      let text=await r.text();
      if(text.includes('<html')||text.includes('CORSPROXY')) throw new Error('プロキシ応答不正');
      text=text.replace(/^\uFEFF/,'');
      const rows=parseCSVFull(text);
      const n=await applySheetRows(rows,PRIZE_SHEET_ID);
      if(n>0){ el.textContent=`✅ ${n}本の賞品を読み込みました`; el.style.color='#34D399'; logPanel('📊 スプレッドシートから賞品プールを読み込みました'); }
      return;
    }
    if(r&&(r.status===403||r.status===401)){ el.textContent='スプレッドシートを「ウェブに公開」してください'; el.style.color='#f87171'; return; }
    el.textContent='取得失敗。ターミナルで npm start を実行し、http://localhost:3000 で開いてください'; el.style.color='#f87171';
  }catch(e){
    el.textContent='エラー: '+e.message+'。npm start で http://localhost:3000 を開いてください'; el.style.color='#f87171';
  }
}

// Build sound debug grid
function buildSoundGrid(){
  const seGrid=document.getElementById('seGrid');
  const bgmGrid=document.getElementById('bgmGrid');
  const ffGrid=document.getElementById('ffGrid');
  seGrid.innerHTML=''; bgmGrid.innerHTML=''; if(ffGrid) ffGrid.innerHTML='';
  
  Object.keys(soundConfig).forEach(key=>{
    const cfg=soundConfig[key];
    const isBGM=key==='bgm';
    const isFF=key.startsWith('ff_');
    let grid=seGrid;
    if(isBGM) grid=bgmGrid;
    else if(isFF && ffGrid) grid=ffGrid;
    else if(isFF) return;
    
    const row=document.createElement('div');
    row.className='sound-row';
    row.innerHTML=`
      <div class="sr-name">${cfg.name}</div>
      <div class="sr-desc">${cfg.desc}</div>
      ${isFF?'':`<button class="sr-toggle ${cfg.enabled?'on':'off'}" data-key="${key}" onclick="toggleSound('${key}')"></button>`}
      ${isBGM?`<label class="sr-upload-btn" title="BGMをアップロード">📁<input type="file" accept="audio/*" onchange="uploadBGM(this)" style="display:none"></label>`:''}
      <button class="sr-play" onclick="playTestSound('${key}')" title="テスト再生">▶</button>
    `;
    grid.appendChild(row);
  });
}

// BGM volume
function syncBGMVolumeSlider(){
  const v=config.bgmVolume??50;
  BGM._vol=v/100;
  const el=document.getElementById('bgmVolume');
  const lbl=document.getElementById('bgmVolumeLabel');
  if(el){ el.value=v; el.min=0; el.max=100; }
  if(lbl) lbl.textContent=v+'%';
}
function setBGMVolume(val){
  const v=Math.max(0,Math.min(100,parseInt(val)||50));
  config.bgmVolume=v;
  BGM._vol=v/100;
  if(BGM._masterGain) BGM._masterGain.gain.value=BGM._vol;
  const el=document.getElementById('bgmVolume');
  const lbl=document.getElementById('bgmVolumeLabel');
  if(el) el.value=v;
  if(lbl) lbl.textContent=v+'%';
  saveToStorage();
}

// BGM file upload
function uploadBGM(input){
  const file=input.files[0];
  if(!file){ input.value=''; return; }
  if(file.size>3*1024*1024){ alert('ファイルは3MB以内にしてください'); input.value=''; return; }
  const reader=new FileReader();
  reader.onload=()=>{
    config.bgmFile=reader.result;
    saveToStorage();
    buildSoundGrid();
    logPanel('🎵 BGMをアップロードしました');
  };
  reader.readAsDataURL(file);
  input.value='';
}

// Toggle individual sound
function toggleBGM(){
  soundConfig.bgm.enabled=!soundConfig.bgm.enabled;
  const btn=document.getElementById('tbBGM');
  if(btn) btn.classList.toggle('on',soundConfig.bgm.enabled);
  const srBtn=document.querySelector('.sr-toggle[data-key="bgm"]');
  if(srBtn) srBtn.classList.toggle('on',soundConfig.bgm.enabled);
  if(soundConfig.bgm.enabled && (state==='idle'||state==='spinning')) BGM.idle();
  else BGM.stop();
  logPanel(soundConfig.bgm.enabled?'🎵 BGM ON':'🎵 BGM OFF');
}
function toggleSound(key){
  soundConfig[key].enabled=!soundConfig[key].enabled;
  const btn=document.querySelector(`.sr-toggle[data-key="${key}"]`);
  btn.classList.toggle('on',soundConfig[key].enabled);
  if(key==='bgm'){
    const tbBtn=document.getElementById('tbBGM');
    if(tbBtn) tbBtn.classList.toggle('on',soundConfig.bgm.enabled);
    if(soundConfig.bgm.enabled && (state==='idle'||state==='spinning')) BGM.idle();
    else BGM.stop();
  }
  btn.classList.toggle('off',!soundConfig[key].enabled);
}

