async function downloadPrizePicsAsZip(){
  const urls=config.imageCache||{};
  const keys=Object.keys(urls).map(Number).sort((a,b)=>a-b);
  if(keys.length===0){
    const st=document.getElementById('sheetStatus');
    if(st){ st.textContent='⚠️ リールに画像がありません。スプレッドシートのF列に画像URLを追加して「更新」してください'; st.style.color='#f87171'; }
    return;
  }
  const btn=document.getElementById('btnBatchDownload');
  const st=document.getElementById('sheetStatus');
  if(btn){ btn.disabled=true; btn.textContent='作成中...'; }
  if(st){ st.textContent='ZIPを作成中...'; st.style.color='var(--text-dim)'; }
  const zip=new JSZip();
  let ok=0, fail=0;
  const proxy=(u)=>'https://api.allorigins.win/raw?url='+encodeURIComponent(u);
  for(const no of keys){
    const url=urls[no];
    try{
      let r=await fetch(url,{mode:'cors'});
      if(!r.ok){ r=await fetch(proxy(url)); }
      if(r.ok){
        const blob=await r.blob();
        const ext=(blob.type||'').includes('jpeg')||(blob.type||'').includes('jpg')?'jpg':(blob.type||'').includes('gif')?'gif':(blob.type||'').includes('webp')?'webp':'png';
        zip.file(`${no}.${ext}`,blob);
        ok++;
      }else fail++;
    }catch(_){ fail++; }
    if(st&&(ok+fail)%5===0){ st.textContent=`ZIP作成中... ${ok+fail}/${keys.length}件`; }
  }
  try{
    const blob=await zip.generateAsync({type:'blob'});
    const a=document.createElement('a');
    a.href=URL.createObjectURL(blob);
    a.download='prize_pics.zip';
    a.click();
    URL.revokeObjectURL(a.href);
    if(st){ st.textContent=`✅ ${ok}件をprize_pics.zipでダウンロードしました`+(fail>0?`（${fail}件スキップ）`:''); st.style.color='#34D399'; setTimeout(()=>{st.textContent='';},6000); }
  }catch(e){
    if(st){ st.textContent='❌ ZIP作成に失敗しました。JSON出力→npm run download-pics をお試しください'; st.style.color='#f87171'; }
  }
  if(btn){ btn.disabled=false; btn.textContent='📥 画像を一括ダウンロード'; }
}
async function downloadPrizePicsAsZip(){
  const slots=config.slotAssignments||[];
  const withUrl=slots.filter(s=>s.imageUrl);
  if(withUrl.length===0){
    const st=document.getElementById('sheetStatus');
    if(st){ st.textContent='⚠️ 画像URLがありません。スプレッドシートの画像URL列を設定して「更新」してください'; st.style.color='#f87171'; }
    return;
  }
  const btn=document.getElementById('btnBatchDownload');
  const st=document.getElementById('sheetStatus');
  if(btn){ btn.disabled=true; btn.textContent='ZIP作成中...'; }
  if(st){ st.textContent='画像を取得中...'; st.style.color='var(--text-dim)'; }
  const zip=new JSZip();
  let ok=0,ng=0;
  const proxy=(u)=>'https://corsproxy.io/?url='+encodeURIComponent(u);
  for(let i=0;i<slots.length;i++){
    const url=slots[i].imageUrl;
    if(!url){ ng++; continue; }
    try{
      let r=await fetch(url);
      if(!r.ok) r=await fetch(proxy(url));
      if(!r.ok) throw new Error('fetch failed');
      const blob=await r.blob();
      const ct=(r.headers.get('content-type')||blob.type||'').toLowerCase();
      let ext='png';
      if(ct.includes('jpeg')||ct.includes('jpg')||url.match(/\.jpe?g$/i)) ext='jpg';
      else if(ct.includes('webp')||url.match(/\.webp$/i)) ext='webp';
      else if(ct.includes('gif')||url.match(/\.gif$/i)) ext='gif';
      else if(url.match(/\.svg$/i)) ext='svg';
      zip.file(`${i+1}.${ext}`,blob);
      ok++;
    }catch(e){ ng++; }
    if(st&&(ok+ng)%20===0){ st.textContent=`ZIP作成中... ${ok+ng}/${slots.length}件`; }
  }
  try{
    const blob=await zip.generateAsync({type:'blob'});
    const a=document.createElement('a');
    a.href=URL.createObjectURL(blob);
    a.download='prize_pics.zip';
    a.click();
    URL.revokeObjectURL(a.href);
    if(st){ st.textContent=`✅ ${ok}枚をZIPでダウンロードしました`+(ng>0?`（${ng}枚はスキップ）`:''); st.style.color='#34D399'; setTimeout(()=>{st.textContent='';},5000); }
  }catch(e){
    if(st){ st.textContent='❌ ZIP作成に失敗しました。JSON出力→npm run download-pics をご利用ください'; st.style.color='#f87171'; }
  }
  if(btn){ btn.disabled=false; btn.textContent='📥 画像を一括ダウンロード'; }
}
