let consoleOn=true;  // デフォルトON。使うときはツールバーのLOGでオフ

function logPanel(msg, highlight){
  const str=String(msg);
  if(!consoleOn) return;
  const inner=document.getElementById('consoleInner');
  if(!inner) return;
  const line=document.createElement('div');
  line.className='console-line';
  if(highlight || msg.includes('Pattern:')) line.classList.add('highlight');
  const now=new Date();
  const ts=String(now.getHours()).padStart(2,'0')+':'+String(now.getMinutes()).padStart(2,'0')+':'+String(now.getSeconds()).padStart(2,'0');
  line.innerHTML=`<span class="cl-time">${ts}</span><span class="cl-msg">${escapeHtml(str)}</span>`;
  inner.appendChild(line);
  inner.scrollTop=inner.scrollHeight;
}
function escapeHtml(s){
  const div=document.createElement('div');
  div.textContent=s;
  return div.innerHTML;
}
// ブラウザの console.error/warn を LOG パネルにも表示（Cursor 内でログ確認しやすくする）
(function(){
  const _err=console.error;
  const _warn=console.warn;
  function toMsg(args){
    return args.map(a=>{
      if(a instanceof Error) return a.message||String(a);
      if(typeof a==='object') try{ return JSON.stringify(a).slice(0,200); }catch(e){ return String(a); }
      return String(a);
    }).join(' ');
  }
  console.error=function(...args){ _err.apply(console,args); try{ logPanel('🔴 '+toMsg(args), true); }catch(e){} };
  console.warn=function(...args){ _warn.apply(console,args); try{ logPanel('🟡 '+toMsg(args), true); }catch(e){} };
})();

