if(_verEl) _verEl.textContent='ver. '+SCRIPT_VERSION;
logPanel('🔇 画面をクリックでSE ON');
// キーボード: Space/S で STOP（ボタンクリックが届かない場合の保険）
document.addEventListener('keydown',(e)=>{
  if((e.code==='Space'||e.key==='s'||e.key==='S')&&state==='spinning'){
    e.preventDefault();
    stopSpin();
  }
});
// Preload speech voices
if('speechSynthesis' in window) speechSynthesis.getVoices();

// Monitor audio unlock
setInterval(()=>{
  if(audioCtx && audioCtx.state==='running' && audioUnlocked && soundEnabled){
    const btn=document.getElementById('tbSound');
    if(btn && !btn._notified){
      btn._notified=true;
      logPanel('SE ON');
    }
  }
},500);

